import PropTypes from 'prop-types';
import css from './FriendList.module.css';

export default function FriendList ({friends}) {
  return (
<ul class="friend-list">
<li class="item">
  <span class="status"></span>
  <img class="avatar" src="" alt="" width="48" />
  <p class="name"></p>
</li>
</ul>

  )
}
